import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <><header>
      <Link to="#" className="logo">Wisata Pulau Seribu</Link>
      <div className="bx bx-menu" id="menu-icon"></div>

      <ul className="navbar">
        <li><Link to="#home">Home</Link></li>
        <li><Link to="#destinations">Destinations</Link></li>
        <li><Link to="#gallery">Gallery</Link></li>
        <li><Link to="#contact">Contact Us</Link></li>
      </ul>
    </header><section className="home" id="home">
        <div className="home-text">
          <h1>Wisata <br /> Pulau Seribu</h1>
          <p>Lorem ipsum, dolor sit amet consectetur adipisicing elit.
            Tempora, consectetur debitis ipsam molestias exercitationem suscipit quo architecto nostrum illo magnam eaque fugiat incidunt error?
            Laboriosam qui enim vel voluptates quidem?</p>
          <a href="#" className="home-btn">See More!</a>
        </div>
      </section></>
  );
};

export default Home;
